import styled from 'styled-components';
import React from 'react';
import Search from '../atoms/searchinput';
import ActionButtons from '../molecules/ActionButtons';

const Inheader = styled.div`
  display: flex;
  -webkit-box-align: center;
  align-items: center;
`;

const Searchtext = styled.div`
    border-radius: 6px;
    border: 1px solid rgb(225, 228, 232);
`;

const Issueheader = styled.h2``;

const Searcharea = styled.div`
    padding: 8px 16px;
    display: flex;
    width: 100%;
`;

const Inheaders = (props) => {

return (
    <Inheader>
        <Issueheader>Issue</Issueheader>
          <Searcharea>
            <Searchtext>
              <Search type="input" placeholder="Issue名で検索"/>
            </Searchtext>
          </Searcharea>
        <ActionButtons open={() => props.open} delete={() => props.delete} />
    </Inheader>
    )

}

export default Inheaders
